export const ROUTES = {
  HOME: '/',
  LOGIN: '/login',
  REGISTER: '/register',
  SCHEDULING: '/scheduling',
  ADMIN: '/admin'
};

export const PUBLIC_ROUTES = [
  ROUTES.HOME,
  ROUTES.LOGIN,
  ROUTES.REGISTER
];

export const PRIVATE_ROUTES = [
  ROUTES.SCHEDULING,
  ROUTES.ADMIN
];
